/*Table structure for table `sys_menu` */

DROP TABLE IF EXISTS `sys_menu`;

CREATE TABLE `sys_menu` (
  `menu_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `name` varchar(64) COLLATE utf8mb4_bin NOT NULL COMMENT '名称',
  `permission` varchar(64) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '菜单权限标识',
  `path` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '前端URL',
  `url` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '请求url',
  `method` varchar(64) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '请求方法',
  `parent_id` int(11) NOT NULL COMMENT '父菜单id',
  `icon` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '图标',
  `component` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '前端页面',
  `sort` int(11) DEFAULT NULL COMMENT '排序',
  `type` char(1) COLLATE utf8mb4_bin NOT NULL COMMENT '0：菜单  1：按钮',
  `del_flag` char(1) COLLATE utf8mb4_bin DEFAULT '0' COMMENT '0:正常 1:删除',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  PRIMARY KEY (`menu_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='菜单';

/*Data for the table `sys_menu` */

/*Table structure for table `sys_role` */

DROP TABLE IF EXISTS `sys_role`;

CREATE TABLE `sys_role` (
  `role_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `role_name` varchar(64) COLLATE utf8mb4_bin NOT NULL COMMENT '角色名',
  `role_code` varchar(64) COLLATE utf8mb4_bin NOT NULL COMMENT '角色编码 （ 用户权限 指的就是这个字段）',
  `role_desc` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL,
  `del_flag` char(1) COLLATE utf8mb4_bin DEFAULT '0' COMMENT '0:正常 1:删除',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  PRIMARY KEY (`role_id`),
  UNIQUE KEY `AK_Key_2` (`role_code`),
  UNIQUE KEY `AK_Key_3` (`role_name`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='角色';

